    mov rax, qword [rbp - 8]  ; From stack [rbp - 8]
    mov rcx, rax
    call closesocket
    add rsp, 32
    ; Integer/pointer return value in rax
    ; 32-bit return value already in eax
    mov [rbp - 6176], rax
    ; IR call: net_cleanup (0 args)
